import React from 'react';
import '../About.css';
import Introduce from '../Introduce';

function About() {
    return (
       <>
       <div className="about-introduce">
           <div className="about-introduce--en">
                <p>Hello.</p>
                <p className="outline-text">Designerㅤ――ㅤDeveloper<div className="outline"></div></p>

                <p>I want to close the gap.</p>
                <p>I'm Daekyo Jeong.</p>
            </div>
            <div className="about-introduce--ko">
                <p>안녕하세요.</p>
                <p className="outline-text">디자이너ㅤ――ㅤ디벨로퍼</p>
                <p>간극을 좁혀보고픈.</p>
                <p>정대교입니다.</p>
            </div>
        </div>
       </>
    )
}

export default About;
